import '../App.css';

class App extends Component {
  state= {
    title: "hello"
  }

  render() {
    return (
      <div className="App">
        <div className="carousel">
        <h1>{this.state.title}</h1>
        <div className="item">
        </div>
        </div>
      </div>
    );
  }
}

export default App;
